import './App.css';
import { Cart, Main } from './pages';
import { Route } from 'react-router-dom';
import { BrowserRouter as Router } from 'react-router-dom';


const Privet = () => {
  return <p>Привет</p>;
};

const Poka = () => {
  return <p>Пока</p>;
};

function App() {
  return (
    <Router>

      <div>
        <Route path="/" exact component={Privet} />
        <Route path="/cart" component={Poka} />
      </div>

    </Router>
  );
}

export default App;
